CREATE TABLE `items` (
  `itemId` int(11) NOT NULL AUTO_INCREMENT,
  `name` longtext NOT NULL,
  `seller` varchar(45) NOT NULL,
  `winner` varchar(45) DEFAULT NULL,
  `currently` int(11) DEFAULT NULL,
  `first_bid` int(11) DEFAULT NULL,
  `number_of_bids` int(11) DEFAULT NULL,
  `country` varchar(45) NOT NULL,
  `postcode` varchar(45) NOT NULL,
  `latitude` varchar(45) DEFAULT NULL,
  `longtitude` varchar(45) DEFAULT NULL,
  `started` datetime DEFAULT NULL,
  `ends` datetime DEFAULT NULL,
  `description` longtext,
  `buy_price` int(11) DEFAULT NULL,
  `publiced_win` tinyint(1) NOT NULL,
  PRIMARY KEY (`itemId`),
  KEY `seller_idx` (`seller`),
  KEY `winner_idx` (`winner`),
  CONSTRAINT `seller` FOREIGN KEY (`seller`) REFERENCES `users` (`username`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `winner` FOREIGN KEY (`winner`) REFERENCES `users` (`username`) ON DELETE NO ACTION ON UPDATE NO ACTION
