INSERT INTO `items` VALUES (1,'New SJ4000 Full HD 1080P 12MP Sports DV Action Car Cam Waterproof Camera Outdoor','gnafpas','Adonis',400,300,0,'Greece','MA 02201-1020','38.47787250329862','22.580807097000616','2015-09-18 16:54:18','2015-09-18 16:54:33','Package included:\r\n1xSJ4000 Camera (Black)\r\n1xWaterproof Case\r\n1xBicycle Stand\r\n1xBase 1\r\n1xBase 2\r\n1xClip\r\n1xFixed Base\r\n1x Switch Support 1\r\n1x Switch Support 2\r\n1x Switch Support 3\r\n1x Adapter\r\n1x Helmet Base\r\n1x Bandage\r\n1x Ribbon\r\n1x 3M Adhesive Tape\r\n1x Wire Rope\r\n1x Data Wire\r\n1x Charger (EU Plug)\r\n1x Wiper\r\n1x Manual',400,1),(10,'Headboard','kaloussa',NULL,495,495,0,'Greece','32004','38.47787162123815','22.58080671996496',NULL,'2015-09-18 13:02:12','Leather headboard',525,1),(11,'Antique Chair','kaloussa','harrynaf',986,798,0,'Greece','32004','38.47787162123815','22.58080671996496',NULL,'2015-09-18 00:00:18','Retreat furniture design transcends not only time, but its original form.  Let me illustrate with four examples of iconic chair and sofa designs – and how they beautifully translate into beds!   From chesterfields to Eames, it is clear that these antique and vintage designs live happily both in living rooms and bedrooms.',986,1);
